import React from "react";

export default function Node(props) {
    const nodeStyle = {
        height: "50px",
        width: "50px",
        gridColumnStart: props.start,
        gridColumnEnd: props.end,
    
        backgroundColor: "#fff",
        borderRadius: "50%",
        border: "2px solid red",
    
        display: "flex",
        justifyContent: "center",
        alignItems: "center"
    }

    return (
        <div style={nodeStyle}>
            {props.value}
        </div>
    );
}
